fragment:
@prefix ns1: <http://www.geneontology.org/formats/oboInOwl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix skos: <http://www.w3.org/2004/02/skos/core#> .

:euthyroid_sick_syndrome a owl:Class ;
    rdfs:label "euthyroid sick syndrome" ;
    ns1:hasDbXref "DOID:2856",
        "EFO:1000931",
        "ICD10CM:E07.81",
        "ICD9:790.94",
        "MEDGEN:41908",
        "MESH:D005067",
        "MedDRA:10015549",
        "NCIT:C113170",
        "SCTID:237542005",
        "UMLS:C0015190" ;
    ns1:id "MONDO:0006755" ;
    ns1:inSubset :otar ;
    rdfs:subClassOf :syndromic_disease,
        :thyroid_gland_disorder ;
    skos:closeMatch :10015549 ;
    skos:exactMatch :237542005,
        :41908,
        :c0015190,
        :d005067,
        :doid_2856,
        :e07.81,
        :ncit_c113170 ;
    :has_definition "Abnormal thyroid function tests, low triiodothyronine with elevated reverse triiodothyronine, in the setting of non-thyroidal illness." ;
    :has_exact_synonym "euthyroid sick syndrome",
        "sick euthyroid syndrome",
        "sick-euthyroid syndrome" .

@prefix ns1: <http://www.geneontology.org/formats/oboInOwl#> .
@prefix ns2: <http://purl.obolibrary.org/obo/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix skos: <http://www.w3.org/2004/02/skos/core#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ellis_van_creveld_syndrome a owl:Class ;
    rdfs:label "Ellis-van Creveld syndrome" ;
    ns2:IAO_0000233 "https://github.com/monarch-initiative/mondo/issues/4948"^^xsd:anyURI ;
    ns1:hasDbXref "DOID:12714",
        "GARD:1301",
        "ICD9:756.55",
        "MEDGEN:8584",
        "MESH:D004613",
        "MedDRA:10008724",
        "NCIT:C84684",
        "NORD:1083",
        "OMIM:225500",
        "Orphanet:289",
        "SCTID:62501005",
        "UMLS:C0013903" ;
    ns1:id "MONDO:0009162" ;
    ns1:inSubset :gard_rare,
        :nord_rare,
        :ordo_disorder,
        :ordo_malformation_syndrome,
        :orphanet_rare,
        :otar,
        :rare ;
    rdfs:seeAlso "https://rarediseases.info.nih.gov/diseases/1301/ellis-van-creveld-syndrome"^^xsd:anyURI ;
    rdfs:subClassOf :autosomal_recessive_disease,
        :cardiogenetic_disease,
        :ectodermal_dysplasia_syndrome,
        :jeune_syndrome ;
    skos:closeMatch :10008724 ;
    skos:exactMatch :225500,
        :62501005,
        :8584,
        :c0013903,
        :d004613,
        :doid_12714,
        :ncit_c84684,
        :orphanet_289 ;
    :has_definition "Ellis-van Creveld syndrome (EVC) is a skeletal and ectoderlam dysplasia characterized by a tetrad of short stature, postaxial polydactyly, ectodermal dysplasia, and congenital heart defects." ;
    :has_exact_synonym "Chondroectodermal dysplasia",
        "EVC",
        "Ellis Van Creveld Syndrome",
        "Ellis Van Creveld syndrome",
        "Ellis-VAN Creveld syndrome",
        "Ellis-van Creveld syndrome",
        "Mesoectodermal dysplasia",
        "mesodermic dysplasia" .
